import React, {useState, useEffect} from "react";
import axios from "axios";
import Level from "../../assets/img/wally1.jpg";

function Level1() {
	const [coordsY, setCoordsY] = useState([]);
	const [coordsX, setCoordsX] = useState([]);
	const [timer, setTimer] = useState(0);

	useEffect(() => {
		axios.get("/API/level1").then(res => {
			setCoordsY(res.data.coordsY);
			setCoordsX(res.data.coordsX);
		});
	}, []);

	const eventHandler = e => {
		console.log(e.clientX);
		console.log("hey");
		e.clientY >= coordsY.min &&
			e.clientY <= coordsY.max &&
			e.clientX >= coordsX.min &&
			e.clientX <= coordsX.max &&
			console.log("You did it!");
	};

	console.log(coordsX.min);
	console.log(coordsY.max);
	return (
		<>
			<header></header>
			<div>
				<img src={Level} alt="Level 1" onClick={eventHandler} />
			</div>
		</>
	);
}

export default Level1;
